import './style.scss'
import Button from "../button";

const Card = ({instrument, auteur, titre, description, background}) => {
    return (
        <div className="card-container" >
            <div className="image-container" style={{backgroundImage:`url(${background})`, backgroundRepeat: 'no-repeat'}}>
               <div className="top-image-container">
                    <div>{instrument}</div>
                    <div>{auteur}</div>
               </div>
            <div>{titre}</div>
            </div>

            <Button variant="no-border" title="Regarder masterclass"></Button>
            <div>{description}</div>

        </div>
    );
};

export default Card;
